import React, { useState, useEffect } from 'react';
import { Layout, Menu } from 'antd';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Element, Link as ScrollLink } from 'react-scroll';
import Login from './Login';
import Logout from './Logout';
import PropertyInputPage from './PropertyInputPage';
import PropertyList from './PropertyList';
import Home from './Home';
import Contact from './Contact';
import PropertyDetail from './PropertyDetail'; // Yeni eklenen PropertyDetail bileÅŸeni

const { Header, Content, Footer } = Layout;

const HomePage = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [properties, setProperties] = useState([]);
  const [currentProperty, setCurrentProperty] = useState(null);

  useEffect(() => {
    const storedProperties = JSON.parse(localStorage.getItem('properties'));
    if (storedProperties) {
      setProperties(storedProperties);
    }
  }, []);

  useEffect(() => {
    localStorage.setItem('properties', JSON.stringify(properties));
  }, [properties]);

  const handleNewProperty = (property) => {
    setProperties((prevProperties) => [...prevProperties, property]);
    setCurrentProperty(null); // Clear current property after adding new
  };

  const handleDeleteProperty = (id) => {
    setProperties((prevProperties) => prevProperties.filter(property => property.id !== id));
  };

  const handleEditProperty = (property) => {
    setCurrentProperty(property);
  };

  const handleUpdateProperty = (updatedProperty) => {
    setProperties((prevProperties) => 
      prevProperties.map(property => property.id === updatedProperty.id ? updatedProperty : property)
    );
    setCurrentProperty(null); // Clear current property after updating
  };

  return (
    <Router>
      <Layout className="layout">
        <Header>
          <div className="logo" />
          <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']}>
            <Menu.Item key="1">
              <ScrollLink to="home" smooth={true} duration={500}>Ana Sayfa</ScrollLink>
            </Menu.Item>
            <Menu.Item key="2">
              <ScrollLink to="properties" smooth={true} duration={500}>Emlak Listesi</ScrollLink>
            </Menu.Item>
            <Menu.Item key="3">
              <ScrollLink to="contact" smooth={true} duration={500}>Ä°letiÅŸim</ScrollLink>
            </Menu.Item>
            {isLoggedIn ? (
              <Menu.Item key="4">
                <Link to="/logout">Ã‡Ä±kÄ±ÅŸ Yap</Link>
              </Menu.Item>
            ) : (
              <Menu.Item key="4">
                <Link to="/login">GiriÅŸ Yap</Link>
              </Menu.Item>
            )}
          </Menu>
        </Header>
        <Content style={{ padding: '0' }}>
          <Element name="home">
            <Home />
          </Element>
          <Element name="properties">
            <div style={{ padding: '50px 0' }}>
              <h2 style={{ textAlign: 'center' }}>Eklenen Evler</h2>
              <PropertyList 
                properties={properties} 
                onDeleteProperty={handleDeleteProperty}
                onEditProperty={handleEditProperty}
              />
            </div>
          </Element>
          <Element name="contact">
            <div style={{ padding: '50px 0', textAlign: 'center' }}>
              <Contact />
            </div>
          </Element>
          <Routes>
            <Route path="/login" element={<Login setIsLoggedIn={setIsLoggedIn} />} />
            <Route path="/logout" element={<Logout setIsLoggedIn={setIsLoggedIn} />} />
            <Route path="/property-input" element={
              <PropertyInputPage 
                onNewProperty={handleNewProperty}
                onUpdateProperty={handleUpdateProperty}
                currentProperty={currentProperty} 
              />
            } />
            <Route path="/property/:id" element={<PropertyDetail properties={properties} />} />
          </Routes>
        </Content>
        <Footer style={{ textAlign: 'center' }}>EmlakÃ§Ä± Otomasyonu Â©2024 Created by You</Footer>
      </Layout>
    </Router>
  );
};

export default HomePage;
